import { useEffect, useState } from "react"
import { useParams } from "react-router-dom"
import Caroussel from "../../compoments/Caroussel"
import TagBox from "../../compoments/TagBox"
import "./style.css"
import Collapse from "../../compoments/Collapse"
import Error from "../ErrorCode"

export default function Article() {
    const param = useParams()
    const [items, setItems] = useState([])

    useEffect(() => {
        fetch("/logements.json")
        .then((e) => e.json())
        .then((e) => {
            setItems(e)
        })
    }, [])

    const lolito = items.filter(item => item.id === param.id).map()
    console.log(lolito)
    return (
        <div className="articlePage">
        <Caroussel />
        {items.filter(item => item.id === param.id).map((item) => (
            <div>
                {check(item)}
                <h1>{item.title}</h1>
                <h4>{item.location}</h4>
                <div className="taglist">
                    <TagBox items={item.tags} />
                </div>
                <div className="collapses">
                    <Collapse description={item.description} type="Description" />
                    <Collapse description={item.equipments} type="Equipements" />
                </div>
            </div>
        ))}
        </div>
    )
}

function check(lol) {
    if (lol < 1) {
        return (
            <Error />
        )
    }
}
